def fibfib(n: int) -> int:
    if n == 0:
        return 0
    elif n == 1:
        return 0
    elif n == 2:
        return 1
    else:
        a, b, c = 0, 0, 1
        for _ in range(3, n + 1):
            a, b, c = b, c, a + b + c
        return c

# Testing the function with examples
print(fibfib(1))  # Output: 0
print(fibfib(5))  # Output: 4
print(fibfib(8))  # Output: 24
```

The `fibfib` function efficiently computes the n-th element of the FibFib number sequence based on the given criteria. It uses dynamic programming to calculate the sequence up to the input `n` and returns the value of the n

